// ==UserScript==
// @name           Steam Market Helper
// @description    Streamlines your usage of the Steam Community Market, allowing for quicker purchases. 
//
// @namespace      http://SpoonGod.no-ip.org/UserScripts/SteamMarket/
// 
// @author         Luke Chater (http://userscripts.org/users/SpoonGod) 
// @version        1.9
//
// @include        http://steamcommunity.com/market/*
// @include        https://steamcommunity.com/market/*
//
// @history        1.0	Automatically accepts the User Agreement
// @history        1.1	The graph and item info panes are automatically hidden to save space and time
// @history        1.1b	Added option to show or hide the large graph at the top
// @history        1.2	Added the ability to skip the confirm dialog altogether for a one-click buy
// @history        1.3	Automatically hides 'SOLD' items that cannot be bought
// @history        1.3b	Added option to show or hide 'SOLD' items that were automatically hidden
// @history        1.4	Prices are now bolded, and items too expensive are struck out and highlighted in red
// @history        1.4b	After your purchase an item all listings are automatically checked against your new wallet balance
// @history        1.5	Attempting to quickbuy an item you cannot afford will redirect you to the add-funds page
// @history        1.5b	Quickbuy buttons for items you cannot afford will be labelled 'Add Funds' instead
// @history        1.6	Quickbuy response messages are now clearer
// @history        1.7	Quickbuy responses and error messages are now sexy
// @history        1.8	Added sounds for quickbuy responses
// @history        1.9	The main market page outlines listings appropriately for quick searching
// @history        1.9b	The tab/window title for listings now starts with the item name
//
// ==/UserScript==
var Path = window.location.pathname.toUpperCase();
if(Path.substr(0,17)=="/MARKET/LISTINGS/"){
// Check and disable that annoying checkbox
var checkbox=document.getElementById("market_buynow_dialog_accept_ssa");
checkbox.checked=true;
checkbox.disabled=true;

// Inject the bypass checkbox UI into the right box
var sg_bypass = document.createElement('input');
sg_bypass.type='checkbox';
sg_bypass.id='sg_bypass';
sg_bypass.checked=true;
var bypass_label = document.createElement('label');
bypass_label.setAttribute('for','sg_bypass');
bypass_label.innerHTML='SKIP DIALOG';
var elems = document.getElementsByTagName('span'), i;
for (i in elems) {
	if(elems[i].className=='market_listing_right_cell market_listing_action_buttons'){
		elems[i].appendChild(sg_bypass);
		elems[i].appendChild(bypass_label);
		break;
	}
}

// Hide some of the unnecessary elements
var css_script = document.createElement('style'); 
css_script.type = "text/css";
var css_base = ".market_large_tab_well,.market_listing_largeimage,#largeiteminfo,.market_listing_iteminfo hr,#largeiteminfo_warning{display:none;}\
span.market_listing_right_cell.market_listing_action_buttons{position:relative;padding-left:20px;padding-right:0px;}\
#sg_bypass{position:absolute;left:10px;}\
.market_listing_price_with_fee{font-weight:bold;}\
#mainContents{position:relative;}\
#mainContents button{position:absolute;top:18px;right:20px;width:90px;}\
div.market_listing_row.market_recent_listing_row.market_red div.market_listing_their_price span{color:#F88;text-decoration:line-through;}\
#sold_div{position:absolute;top:20px;right:10px;width:119px;text-align:right;}\
#graph_div{position:absolute;top:26px;right:30px;width:110px;text-align:right;}\
#sold_div input,#graph_div input{position:absolute;top:1px;left:0px;margin:0px;}\
.market_listing_filter_clear_button_container{margin-top:3px;margin-right:130px;}\
.sg_attempt{background-color:#332;border-color:#FF8;box-shadow:0px 0px 10px #FF0, 0px 0px 10px #FF0 inset;}\
.sg_success{background-color:#232;border-color:#8F8;box-shadow:0px 0px 10px #0F0, 0px 0px 10px #0F0 inset;}\
.sg_error,.market_sold{background-color:#322;border-color:#F88;box-shadow:0px 0px 10px #F00, 0px 0px 10px #F00 inset;}\
.sg_attempt,.sg_success,.sg_error,.sg_market_sold{text-align:center;}\
//.sg_error .market_listing_purchase_message{color:#F00;}";
var css_hidegraph = ".market_listing_iteminfo{display:none;}";
var css_hide_sold = ".market_sold{display:none;}";
document.getElementsByTagName('head')[0].appendChild(css_script);
css_script.innerHTML = css_base+css_hidegraph+css_hide_sold;
function restyle(){
	var css_input = css_base;
	if(sg_hide_graph.checked==false){css_input+=css_hidegraph;}
	if(sg_filter_sold.checked==false){css_input+=css_hide_sold;}
	css_script.innerHTML = css_input;
}

// Add a checkbox to show/hide the graph.
var graph_div = document.createElement('div');
graph_div.id='graph_div';
document.getElementById('mainContents').appendChild(graph_div);
var sg_hide_graph = document.createElement('input');
sg_hide_graph.type='checkbox';
sg_hide_graph.checked=false;
sg_hide_graph.id='sg_hide_graph';
sg_hide_graph.onchange=function(){restyle();};
graph_div.appendChild(sg_hide_graph);
var graph_label = document.createElement('label');
graph_label.setAttribute('for','sg_hide_graph');
graph_label.innerHTML='SHOW GRAPH';
graph_div.appendChild(graph_label);

// Add a checkbox to hide SOLD! items
var sold_div = document.createElement('div');
sold_div.id='sold_div';
document.getElementById('market_listing_filter_form').appendChild(sold_div);
var sg_filter_sold = document.createElement('input');
sg_filter_sold.type='checkbox';
sg_filter_sold.checked=false;
sg_filter_sold.id='sg_filter_sold';
sg_filter_sold.onchange=function(){restyle();};
sold_div.appendChild(sg_filter_sold);
var filter_label = document.createElement('label');
filter_label.setAttribute('for','sg_filter_sold');
filter_label.innerHTML='Show Sold Items';
sold_div.appendChild(filter_label);

// Override the buy button's function:
var jscript = document.createElement('script'); 
jscript.type = "text/javascript"; 
jscript.innerHTML = "function BuyMarketListing( sElementPrefix, listingid, appid, contextid, itemid ){\
	if ( !g_bLoggedIn )\
	{\
		showModal( 'NotLoggedInWarning', true );\
		return;\
	}\
	if ( !g_rgAssets[appid] || !g_rgAssets[appid][contextid] || !g_rgAssets[appid][contextid][itemid] ){return;}\
	if(sg_bypass.checked==true){\
		var rgListing = g_rgListingInfo[listingid];\
		if(rgListing['converted_price']>g_rgWalletInfo['wallet_balance']){\
			sg_walletf_s.play();\
			var sCurrentURL = window.location.protocol + '//' + window.location.host + window.location.pathname;\
			var return_url = encodeURIComponent( sCurrentURL + '#buy' + sElementPrefix + '|' + listingid + '|' + appid + '|' + contextid + '|'  + itemid );\
			window.location = 'http://store.steampowered.com/steamaccount/addfunds?marketlisting=' + listingid + '&returnurl=' + return_url;\
		}else{\
			sg_attempt_s.play();\
			document.getElementById('listing_'+listingid).className='sg_attempt market_listing_row market_recent_listing_row listing_'+listingid;\
			document.getElementById('listing_'+listingid).innerHTML='<div class=\"market_listing_purchase_message\" style=\"color:#FF0;\">Attempting to quick-purchase this item...</div>';\
			new Ajax.Request( 'http://steamcommunity.com/market/buylisting/' + listingid, {\
				method: 'post',\
				parameters: {\
					sessionid: g_sessionID,\
					currency: g_rgWalletInfo['wallet_currency'],\
					subtotal: rgListing['converted_price'],\
					fee: rgListing['converted_fee'],\
					total: rgListing['converted_price'] + rgListing['converted_fee']\
				},\
				onSuccess: function( transport ) {\
					document.getElementById('listing_'+listingid).className+=' sg_success';\
					document.getElementById('listing_'+listingid).innerHTML='<div class=\"market_listing_purchase_message\">You quick-purchased this item. View it in your <a href=\"http://steamcommunity.com/my/inventory/\">inventory</a>.</div>';\
					sg_succeed_s.play();\
					checkPrices();\
					BuyItemDialog.OnSuccess( transport );\
				},\
				onFailure: function( transport ) {\
					document.getElementById('listing_'+listingid).className+=' sg_error';\
					document.getElementById('listing_'+listingid).innerHTML='<div class=\"market_listing_purchase_message\">There was a problem purchasing your item. The listing may have been removed. Refresh the page and try again.</div>';\
					sg_failure_s.play();\
					BuyItemDialog.OnFailure( transport );\
				}\
			} );\
		}\
	}else{\
		BuyItemDialog.Show( sElementPrefix, listingid, g_rgAssets[appid][contextid][itemid] );\
	}\
}\
function checkPrices(){\
	var moolah = g_rgWalletInfo['wallet_balance'];\
	var elems = document.getElementsByTagName('div'), i;\
	for (i in elems) {\
		var elem = elems[i];\
		var classname=elem.className;\
		if(classname){if(classname.length>0){\
			var classes=elem.className.split(' ');\
			if(classes[0]=='market_listing_row' && classes[1]=='market_recent_listing_row' && classes[2].substr(0,8)=='listing_'){\
				var nodes = elem.childNodes, j;\
				for (j in elems) {\
					var node=nodes[j];\
					if(node.className){if(node.className=='market_listing_right_cell market_listing_their_price'){\
						var temp_test=node.childNodes[1].childNodes[1];\
						break;\
					}}\
				}\
				if(temp_test.innerHTML.indexOf('Sold!')>-1){\
					elem.className='market_listing_row market_recent_listing_row '+classes[2]+' market_sold';\
				}else{\
					var temp_info=g_rgListingInfo[classes[2].substr(8)];\
					var temp_total = temp_info['converted_price'] + temp_info['converted_fee'];\
					if(temp_total>moolah){\
						elem.className='market_listing_row market_recent_listing_row '+classes[2]+' market_red';\
						elem.childNodes[3].childNodes[1].childNodes[1].childNodes[3].innerHTML='Add Funds';\
					}\
				}\
			}\
		}}\
	}\
}\
checkPrices();\
var sg_attempt_s = new Audio();\
sg_attempt_s.src = \"data:audio/x-wav;base64,\";\
var sg_failure_s = new Audio();\
sg_failure_s.src = \"data:audio/x-wav;base64,\";\
var sg_succeed_s = new Audio();\
sg_succeed_s.src = \"data:audio/x-wav;base64,\";\
var sg_walletf_s = new Audio();\
sg_walletf_s.src = \"data:audio/x-wav;base64,\";\
";
document.getElementsByTagName('head')[0].appendChild(jscript);
var titl = document.getElementsByTagName('title')[0];
var tit = titl.innerHTML;
var cop = tit;
var buttpos = tit.indexOf("::");
if(buttpos>0){
	cop = tit.substring(0,buttpos);
	tit = tit.substring(buttpos+2);
	buttpos=tit.indexOf("-");
	if(buttpos>0){titl.innerHTML = tit.substring(buttpos+1)+" - "+cop;}
}
}else{ // Main Market Page
	var css_script = document.createElement('style'); 
	css_script.type = "text/css";
	var css_base = ".sg_sold{background-image: -ms-linear-gradient(left, #333333 0%, #33AA33 100%);\
background-image: -moz-linear-gradient(left, #333333 0%, #33AA33 100%);\
background-image: -o-linear-gradient(left, #333333 0%, #33AA33 100%);\
background-image: -webkit-gradient(linear, left top, right top, color-stop(0, #333333), color-stop(1, #33AA33));\
background-image: -webkit-linear-gradient(left, #333333 0%, #33AA33 100%);\
background-image: linear-gradient(to right, #333333 0%, #33AA33 100%);\
}";
	document.getElementsByTagName('head')[0].appendChild(css_script);
	css_script.innerHTML = css_base;

	
	var jscript = document.createElement('script'); 
	jscript.type = "text/javascript"; 
	jscript.innerHTML = "function setCookie(c_name,value,exdays){\
	var exdate=new Date();\
	exdate.setDate(exdate.getDate() + exdays);\
	var c_value=escape(value) + ((exdays==null) ? '' : '; expires='+exdate.toUTCString());\
	document.cookie=c_name + '=' + c_value;\
}\
function getCookie(c_name){\
	var c_value = document.cookie;\
	var c_start = c_value.indexOf(' ' + c_name + '=');\
	if (c_start == -1) c_start = c_value.indexOf(c_name + '=');\
	if (c_start == -1){\
		c_value = null;\
	}else{\
		c_start = c_value.indexOf('=', c_start) + 1;\
		var c_end = c_value.indexOf(';', c_start);\
		if (c_end == -1){\
			c_end = c_value.length;\
		}\
		c_value = unescape(c_value.substring(c_start,c_end));\
	}\
	return c_value;\
}\
var sg_cookie = document.createElement('a');\
sg_cookie.id='sg_cookie';\
sg_cookie.innerHTML=getCookie('sg_listings');\
sg_cookie.style.display='none';\
document.body.appendChild(sg_cookie);\
\
";
	document.getElementsByTagName('head')[0].appendChild(jscript);
	var sg_cookie = document.getElementById("sg_cookie");
	var sg_cookie_txt = sg_cookie.innerHTML;
	//var sg_listings_old=JSON.parse(sg_cookie_txt.toString());
	sg_cookie.parentNode.removeChild(sg_cookie);
	var sg_listings_new=new Array;
	var sg_listings_old=new Array;
	var elems = document.getElementsByTagName('div'), i;
	for (i in elems) {
		var classN = elems[i].className;
		if(classN==undefined) continue;
		classN=classN.toUpperCase();
		if(classN.indexOf("MARKET_LISTING_ROW")>=0&classN.indexOf("MARKET_RECENT_LISTING_ROW")>=0){
			var elem = elems[i];
			var sg_col = elem.childNodes[1].style.borderColor;
			elem.style.borderColor=sg_col;
			var sg_listingn = elem.id;
			if(sg_listingn==undefined) continue;
			sg_listingn=sg_listingn.toUpperCase();
			if(sg_listingn.substr(0,10)=="MYLISTING_"){
				var sg_price = elem.childNodes[5].childNodes[1].childNodes[1].innerHTML.replace(/\s+/g, ' ');
				elem.childNodes[5].childNodes[1].childNodes[1].innerHTML=sg_price;
				var sg_date = elem.childNodes[7].innerHTML.replace(/\s+/g, ' ');
				elem.childNodes[7].innerHTML=sg_date
				var sg_listing=new Object;
				var sg_listingid=sg_listingn.substr(10);
				sg_listing.id=sg_listingid; // Obselete?
				var sg_temp_img=document.getElementById("mylisting_"+sg_listingid+"_image");
				sg_listing.img=sg_temp_img.src;
				if(sg_col!=undefined&sg_col!="") sg_listing.col=sg_col;
				var sg_temp_bg=sg_temp_img.style.backgroundColor;
				if(sg_temp_bg!=undefined&sg_temp_bg!="") sg_listing.bgc=sg_temp_bg;
				sg_listing.price=sg_price;
				sg_listing.date=sg_date;
				sg_listings_new.push(sg_listing);
				var sg_temp_name = elem.childNodes[9].childNodes[1].childNodes[0];
				sg_listing.name=sg_temp_name.innerHTML;
				sg_listing.link=sg_temp_name.href;
				sg_listing.game=elem.childNodes[9].childNodes[4].innerHTML;
			}
		}
	}
	console.log(JSON.stringify(sg_listings_new));
	var jscript = document.createElement('script'); 
	jscript.type = "text/javascript"; 
	jscript.innerHTML = "setCookie('sg_listings','"+JSON.stringify(sg_listings_new)+"',365);";
	document.getElementsByTagName('head')[0].appendChild(jscript);
	var list=document.getElementById("tabContentsMyListings").childNodes[1];
	for(i in sg_listings_old){ // Show SOLD listings
		var sg_listing=sg_listings_new[i];
		var currentid=sg_listing.id;
		var skip = false;
		for(j in sg_listings_new){
			if(sg_listings_new[j].id==currentid){
				skip=true;
				console.log("Skipping "+i+", matched with "+j+".");
				break;
			}
		}
		if(skip==true) continue;
		var sg_col=sg_listing.col;
		var newnode = document.createElement('div');
		var listnode=newnode;
		newnode.className="market_listing_row market_recent_listing_row sg_sold listing_"+currentid;
		newnode.id="mylisting_"+currentid;
		if(sg_col!=undefined) newnode.style.borderColor=sg_col;
		list.appendChild(newnode);
		
		// Img
		newnode = document.createElement('img');
		newnode.id="mylisting_"+currentid+"_img";
		newnode.src=sg_listing.img;
		newnode.className="market_listing_item_img";
		if(sg_col!=undefined) newnode.style.borderColor=sg_col;
		if(sg_listing.bgc!=undefined) newnode.style.backgroundColor=sg_listing.bgc;
		listnode.appendChild(newnode);
		
		// REMOVE button
		newnode = document.createElement('div');
		var oldnode=newnode;
		newnode.className="market_listing_right_cell market_listing_edit_buttons";
		listnode.appendChild(newnode);
		
		newnode = document.createElement('div');
		newnode.className="market_listing_cancel_button";
		oldnode.appendChild(newnode);
		oldnode=newnode;
		
		newnode = document.createElement('a');
		newnode.className="item_market_action_button item_market_action_button_edit";
		newnode.href="javascript:sg_removeListing("+i+");";
		oldnode.appendChild(newnode);
		oldnode=newnode;
		
		newnode = document.createElement('span');
		newnode.className="item_market_action_button_edge item_market_action_button_left";
		oldnode.appendChild(newnode);
		newnode = document.createElement('span');
		newnode.className="item_market_action_button_contents";
		newnode.innerHTML="SOLD";
		oldnode.appendChild(newnode);
		newnode = document.createElement('span');
		newnode.className="item_market_action_button_edge item_market_action_button_right";
		oldnode.appendChild(newnode);
		newnode = document.createElement('span');
		newnode.className="item_market_action_button_preload";
		oldnode.appendChild(newnode);
		
		// Price
		newnode = document.createElement('div');
		newnode.className="market_listing_right_cell market_listing_my_price";
		listnode.appendChild(newnode);
		oldnode=newnode;
		newnode = document.createElement('span');
		oldnode.appendChild(newnode);
		oldnode=newnode;
		newnode = document.createElement('span');
		newnode.className="market_listing_price";
		newnode.innerHTML=sg_listing.price;
		oldnode.appendChild(newnode);
		
		// Date
		newnode = document.createElement('div');
		newnode.className="market_listing_right_cell market_listing_listed_date";
		newnode.innerHTML=sg_listing.date;
		listnode.appendChild(newnode);
		
		// Name
		newnode = document.createElement('div');
		oldnode=newnode;
		newnode.className="market_listing_item_name_block";
		listnode.appendChild(newnode);
		newnode = document.createElement('span');
		newnode.className="market_listing_item_name";
		newnode.id="mylisting_"+currentid+"_name";
		newnode.style.color=sg_col;
		oldnode.appendChild(newnode);
		var tmpnode=newnode;
		newnode = document.createElement('a');
		newnode.className="market_listing_item_name_link";
		newnode.href=sg_listing.link;
		newnode.innerHTML=sg_listing.name;
		tmpnode.appendChild(newnode);
		
		newnode = document.createElement('br');
		oldnode.appendChild(newnode);
		newnode = document.createElement('span');
		newnode.className="market_listing_game_name";
		newnode.innerHTML=sg_listing.game;
		oldnode.appendChild(newnode);
		
	}
}

function removeMe(elemid){
	elem.parentNode.removeChild(elem);
}